import "./App.css";
import "./QuizPage.css";
import "./Answers";
import Answers from "./Answers";
import "./Quizzes";

const Questions = (quiz) => {
  return (
    <div>
      <div>{quiz.questions}</div>
      <div>
        {quiz.questions.answers.map((answers) => (
          <Answers answers={answers} />
        ))}
      </div>
    </div>
  );
};

export default Questions;
